// Component imports
import React, {useContext} from 'react';
import { HomePageContext } from '../../contexts/HomePageContext';

export function HomePageDebugger(){
    const {hpContext, setHpContext} = useContext(HomePageContext);

    return(
        <p style={{position: 'fixed', bottom: 0, left: 0, backgroundColor: '#ee9999'}}>
            <h5><b>Debugger</b></h5><br />
            <b>RoomID:</b> {hpContext.roomSelection.id}<br />
            <b>RoomName:</b> {hpContext.roomSelection.name}<br />
            <b>Bookings:</b> {hpContext.bookings.bookings !== [] ? "true" : "false"}<br />
            <b>Booking Selected:</b> {hpContext.bookings.selected !== null ? hpContext.bookings.selected?.booking?.id : "false"}<br />
            {hpContext.bookings.selected !== null ?
            <>
            <b>View Mode:</b> {hpContext.uiControl.viewMode ? "true" : "false"}<br />
            <b>Edit Mode:</b> {hpContext.uiControl.editMode ? "true" : "false"}<br />
            <b>Day:</b> {hpContext.bookings.selected.day}<br />
            <b>Lesson:</b> {hpContext.bookings.selected.lesson.key}<br />
            </>
            : null}
        </p>
    );
};
